Twee echtparen gaan een avond uit eten in een restaurant. Ze praten over alledaagse dingen, dingen waar mensen tijdens etentjes over praten: werk, de laatste films, de oorlog in Irak, vakantieplannen, et cetera. Maar ondertussen vermijden ze waar ze het eigenlijk over moeten hebben: hun kinderen. De twee vijftienjarige zoons van beide echtparen, Michel en Rick, hebben samen iets uitgehaald wat hun toekomst kan verwoesten. Tot dusver zijn alleen vage beelden van de twee in Opsporing verzocht vertoond en zit het onderzoek naar hun identiteit vast. Maar hoe lang nog? Twee mannen, twee vrouwen, twee zoons Ã¢â‚¬â€œ wie durft een beslissing te nemen over de toekomst van zijn eigen kind? Wat het nog ingewikkelder maakt is dat de vader van een van de jongens de beoogde nieuwe minister-president van Nederland is.



